	/* findWords */
		exports.findWords = findWords
		function findWords(search) {
			try {
				search = search.replace(/\s/gi,"") || ""
				
				if (!search || (search.length < 2) || (search.length > 8) || (!(/[A-Za-z]/gi).test(search))) {
					return JSON.stringify({success: false, message: "Words must be 2 - 8 letters."})
				}
				else {
					var letters = search.replace(/\s/gi,"").split("")
					var words = buildWords([], letters, "")
					
					var results = {}
					for (var w in words) {
						var length = words[w].length
						if (!results[length] || !results[length].length) {
							results[length] = [words[w]]
						}
						else {
							results[length].push(words[w])
						}
					}

					var output = ""
					var keys = Object.keys(results).sort(function(a,b) { return a > b })
					for (var k in keys) {
						output += "<details class='section'><summary class='number'>" + keys[k] + " letters:</summary>"
						
						results[keys[k]] = results[keys[k]].sort()
						for (var r in results[keys[k]]) {
							output += "<li>" + results[keys[k]][r] + "</li>"
						}

						output += "</details>"
					}

					return JSON.stringify({success: true, results: results, html: output})
				}
			}
			catch (error) {
				console.log(error)
				return JSON.stringify({success: false, message: "unable to find words"})
			}
		}

	/* buildWords */
		function buildWords(words, letters, stem) {
			for (var l in letters) {
				var word = stem + letters[l]
				if ((word.length > 1) && (dictionary[word[0]].indexOf(word) > -1)) {
					words.push(word)
				}

				if (letters.length > 1) {
					var otherLetters = letters.join("").split("")
						otherLetters.splice(l, 1)
					
					words = buildWords(words, otherLetters, stem + letters[l])
				}
			}

			return words.filter(function(w, i, self) {
				return self.indexOf(w) == i
			})
		}
